column1:
Tall, slim, very fair and elegant. Extremely cordial, respectful, very caring, modest and responsible; 

Intelligent, smart and knows how to strike a balance in life;

Interested in fine arts, music, literature, reading and travel. 

From a highly educated and well placed family.,"A highly qualified, well established, simple yet smart life partner who values a woman's education, talents, impeccable character and virtues more than anything else.
